import './App.css';

import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Login from './Login';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </Router>
  );
};

export default App;
